import React, {useState} from 'react';

const ZipCode = () => {
let [zipCode, setZipCode] = useState("");

return (
<div className="zipCode">
<h3>Zipcode: <input 
  id="zipCode" 
  name="zipCode" 
  type="text" 
  value={zipCode}
  onChange={(e) => setZipCode(e.target.value)} /></h3>  
</div>
)
}

export default ZipCode;
